  true,\n\t\"url\": null,\n\t\"notes\": \"The Presidents Council of Advisors on Science
  and Technology (PCAST) 20131 and 20102 reviews of the Federal Networking and Information
  Technology Research and Development (NITRD) Program3 have identified challenges
  to personal privacy in the digital era as a significant impairment undermining societal
  benefits from large-scale deployments of networking and IT (NIT) systems. Consequently,
  PCAST has called upon federal research agencies to create a multi-agency initiative
  focused on developing scientific and engineering foundations for protecting privacy,
  which could then be the basis for new technologies and solutions in this space.
  In August 2013 and in February 2014, the White House Office of Science and Technology
  Policy (OSTP) issued two Requests For Information (RFI) to NITRD on privacy research
  activities pursued by the agencies in NITRD, to understand what research is taking
  place, and to explore a possible multi-agency research agenda in foundations of
  privacy. This report summarizes current research in privacy within NITRD.\",\n\t\"license_title\":
